    <ul>
      {reviews.map((review) => {
        console.log(review);
        return (
          <li>
            <div>
              <div></div>
              <div>
                <p></p>
                <div>
                  <Icon />
                </div>
              </div>
            </div>
            <p></p>
          </li>
        );
      })}
    </ul>
  );
};
